# 创建QPixmap
def createPixmap(icon_base64_str, width, height):

    pixmap = QPixmap()
    pixmap.loadFromData(base64.b64decode(icon_base64_str))
    pixmap = pixmap.scaled(int(width*RATE),
                           int(height*RATE),
                           Qt.KeepAspectRatio,
                           Qt.SmoothTransformation)
    return pixmap


# 创建QIcon
def createIcon(pixmap):

    icon = QIcon()
    icon.addPixmap(pixmap, QIcon.Normal, QIcon.On)

    return icon


# 创建QCursor
def createCursor(pixmap):

    return QCursor(pixmap, 0, 0)


